Root Cause Analysis
After thorough investigation, here's what's happening:
The Problem: The /api/racket/recommend API returns image_url for each racket, but 8 out of 14 rackets (57%) have wrong images. The API appears to search joybadminton.com's Shopify store for product images, and when a racket isn't found in the store (discontinued/older models), the search returns the closest available product's image instead — which is the wrong racket.
Examples of mismatches:
Racket NameGets Image OfReasonVoltric Z-Force IIAstrox 88D ProNot in Shopify storeTurbo Charging 75Axforce 80Not in Shopify storeBladeX 900 Moon MaxAxforce 80Not in Shopify storeDuora 10, GR-020G, etc.Various wrong imagesNot in Shopify store
The Irony: The app already has a dedicated /api/racket/image endpoint with a verified, curated image database (source: "verified") that returns the correct image for every racket by ID — but the /api/racket/recommend endpoint doesn't use it!

Best Solution
Fix the /api/racket/recommend API route (in src/app/api/racket/recommend/route.ts) to use the verified image database from the /api/racket/image service when populating image_url for each recommendation. Instead of searching Shopify for images, it should look up each racket by its id in the verified image database.
If modifying the backend is not immediately possible, a frontend workaround in src/app/racket/page.tsx would be:
tsx// After getting recommendations, fetch verified images for each racket
const data = await response.json();
const recommendations = data.recommendations;

// Override image_url with verified images
const updatedRecommendations = await Promise.all(
  recommendations.map(async (racket) => {
    try {
      const imgResp = await fetch(`/api/racket/image?id=${encodeURIComponent(racket.id)}`);
      const imgData = await imgResp.json();
      if (imgData.source === 'verified' && imgData.imageUrl) {
        return { ...racket, image_url: imgData.imageUrl };
      }
    } catch (e) {
      // Fall back to original image_url
    }
    return racket;
  })
);

setRecommendations(updatedRecommendations);
The backend fix is preferred because it avoids N+1 API calls from the frontend and ensures all consumers of the recommend API get correct images. The recommend route should import/call the same verified image lookup function used by /api/racket/image and replace the Shopify search-based image resolution.

